const toolbar = {
  avatar: "images/avatar/avatar.jpg",
  items: [
    { title: "About", link: "#about" },
    { title: "Experiences", link: "#experiences" },
    { title: "Projects", link: "#projects" },
    { title: "Skills", link: "#skills" },
    { title: "Hobbies", link: "#hobbies" }
  ]
};

export default toolbar;
